Can we add the name and id props to match the <input type="checkbox" /> and have onChange emit an event type Object:
event = {
  target: {
    name: props.name,
    checked: props.checked,
    type: 'checkbox',
  }
}
This should enable easier integration into many of our forms where we have helper function for controlling state:
handleFieldChange({ target }) {
   if (target.type === 'checkbox') {
     this.setState({ [target.name]: target.checked });
   }
}
Not a blocker, but will be a good followup.

