@daveta I'm not sure if we are at cross-purposes here - I am struggling to understand what you are describing.  Let me try and outline exactly as I see it and hopefully we can get some clarity.
Within the context of the test, we will never see the additional activity properties within the calls to the telemetryClient, as they are not pushed in. This is because it is the responsibility of the telemetryClient itself to grab the activity from the correlationContext and add them to the outgoing app insights events within the addBotIdentifiers method, after it has one of the Track methods called



