@tbergq I don't know man. Are you sure you are not doing something dodgy there? We should always get the date in the UTC format (at least from our GraphQL):
{
  "data": {
    "allFlights": {
      "edges": [
        {
          "node": {
            "arrival": {
              "localTime": "2018-08-10T00:40:00.000Z",
              "time": "2018-08-10T05:40:00.000Z"
            },
            "departure": {
              "localTime": "2018-08-08T23:55:00.000Z",
              "time": "2018-08-08T21:55:00.000Z"
            }
          }
        },
...
It's defined by the DateTime type in GraphQL:

A date-time string at UTC, such as 2007-12-03T10:15:30Z, compliant with the date-time format outlined in section 5.6 of the RFC 3339 profile of the ISO 8601 standard for representation of dates and times using the Gregorian calendar.

So this is why it's so important to call the Intl with UTC timezone (so it will stay in UTC and it won't be converted into local timezone):
Intl.DateTimeFormat('en', {timeZone: 'UTC', year: 'numeric', month: 'numeric', day: 'numeric', hour: 'numeric', minute: 'numeric'}).format(new Date('2018-08-10T00:40:00.000Z'))
> "8/10/2018, 12:40 AM"   (correct)

BUT

Intl.DateTimeFormat('en', {year: 'numeric', month: 'numeric', day: 'numeric', hour: 'numeric', minute: 'numeric'}).format(new Date('2018-08-10T00:40:00.000Z'))
> "8/10/2018, 2:40 AM"   (WTF? It's not true...)

Maybe I don't understand what it's wrong exactly. Can you please elaborate it more with some example?

